function getData(){$.ajax({type:"GET",datatype:"application/json",url:"/users/searchUsers",success:function(a){console.log("Got you the Search GET",a),displayData(a)},error:function(a){console.log("No Search GET for you! ",a)},complete:function(){console.log("Search GET function done")}})}function displayData(a){for(var b=0;b<a.length;b++)$(".displayUsers").append("Username: ",a[b].username)}$(document).ready(function(){getData()});